import React from "react";
import { Checkbox } from "react-control-library";
import { Input, Form, Label, FormGroup } from "reactstrap";
import "./EkMalzemeler.css"

export default function App() {
  const [Pepperoni, setPepperoni] = React.useState(true);
  const [Sosis, setSosis] = React.useState(false);
  const [KanadaJambonu, setKanadaJambonu] = React.useState(false);
  const [TavukIzgara, setTavukIzgara] = React.useState(false);
  const [Sogan, setSogan] = React.useState(false);
  const [Domates, setDomates] = React.useState(false);
  const [Mısır, setMısır] = React.useState(false);
  const [Sucuk, setSucuk] = React.useState(false);
  const [Jalepino, setJalepino] = React.useState(false);
  const [Sarımsak, setSarımsak] = React.useState(false);
  const [Biber, setBiber] = React.useState(false);
  const [Ananas, setAnanas] = React.useState(false);
  const [Kabak, setKabak] = React.useState(false);

 const checkboxes = [
    'Checkbox 1', 'Checkbox 2', 'Checkbox 3',
    'Checkbox 4', 'Checkbox 5', 'Checkbox 6',
    'Checkbox 7', 'Checkbox 8', 'Checkbox 9',
    'Checkbox 10', 'Checkbox 11', 'Checkbox 12',
    'Checkbox 13', 'Checkbox 14'
  ];

  const rows = 5; // 5 satır
  const cols = 3; // 3 sütun

  const checkboxesGrid = [];

  for (let i = 0; i < rows; i++) {
    const row = [];

    for (let j = 0; j < cols; j++) {
      const index = i * cols + j;
      if (index < checkboxes.length) {
        row.push(
          <FormGroup check key={index}>
            <Label check>
              <Input type="checkbox" /> {checkboxes[index]}
            </Label>
          </FormGroup>
        );
      }
    }

    checkboxesGrid.push(
      <div key={i} style={{ display: 'flex', justifyContent: 'center' }}>
        {row}
      </div>
    );
  }

  // 5. satırın sonundaki 2 öğeyi 3. satırın sonuna ekleyin
  if (checkboxesGrid.length >= 5 && checkboxesGrid[4].props.children.length > 2) {
    const extraItems = checkboxesGrid[4].props.children.splice(2);
    checkboxesGrid.push(
      <div key={5} style={{ display: 'flex', justifyContent: 'center' }}>
        {extraItems}
      </div>
    );
  }

  return (
    <Form>
      {checkboxesGrid}
    </Form>
  );


  return (
    <>
    <h4>Ek Malzemeler</h4>
    <p>En Fazla 10 Malzeme seçebilirsiniz 5TL</p>
    <div id="checkbox" style={{ }}>
      <br />
      <Checkbox
        inputTag={Input}
        checked={Pepperoni}
        onChange={(e) => setPepperoni(e.target.checked)}
      />{" "}
      Pepperoni
      <br />
      <Checkbox
        inputTag={Input}
        checked={Sosis}
        onChange={(e) => setSosis(e.target.checked)}
      />{" "}
      Sosis
      <br />
      <Checkbox
        inputTag={Input}
        checked={KanadaJambonu}
        onChange={(e) => setKanadaJambonu(e.target.checked)}
      />{" "}
      KanadaJambonu
      <br />
      <Checkbox
        inputTag={Input}
        checked={TavukIzgara}
        onChange={(e) => setTavukIzgara(e.target.checked)}
      />{" "}
      TavukIzgara
      <br />
      <Checkbox
        inputTag={Input}
        checked={Sogan}
        onChange={(e) => setSogan(e.target.checked)}
      />{" "}
      Sogan
      <br />
      <Checkbox
        inputTag={Input}
        checked={Domates}
        onChange={(e) => setDomates(e.target.checked)}
      />{" "}
      Domates
      <br />
      <Checkbox
        inputTag={Input}
        checked={Mısır}
        onChange={(e) => setMısır(e.target.checked)}
      />{" "}
      Mısır
      <br />
      <Checkbox
        inputTag={Input}
        checked={Sucuk}
        onChange={(e) => setSucuk(e.target.checked)}
      />{" "}
      Sucuk
      <br />
      <Checkbox
        inputTag={Input}
        checked={Jalepino}
        onChange={(e) => setJalepino(e.target.checked)}
      />{" "}
      Jalepino
      <br />
      <Checkbox
        inputTag={Input}
        checked={Sarımsak}
        onChange={(e) => setSarımsak(e.target.checked)}
      />{" "}
      Sarımsak
      <br />
      <Checkbox
        inputTag={Input}
        checked={Biber}
        onChange={(e) => setBiber(e.target.checked)}
      />{" "}
      Biber
      <br />
      <Checkbox
        inputTag={Input}
        checked={Ananas}
        onChange={(e) => setAnanas(e.target.checked)}
      />{" "}
      Ananas
      <br />
      <Checkbox
        inputTag={Input}
        checked={Kabak}
        onChange={(e) => setKabak(e.target.checked)}
      />{" "}
      Kabak
      <br />
    </div>
    </>
  );


}
